import { Form, Button, Input, Select, DatePicker, Layout} from 'antd'
import React from 'react';

import { useState } from 'react'

const App: React.FC = () => {
    const { Option } = Select;
    const [form] = Form.useForm();
    const dateFormat = 'DD/MM/YYYY';
  
  function finish(value: any){
    console.log(value);
    
  };


  const onGenderChange= (value: string) =>{
    switch (value) {
        case 'male':
          form.setFieldsValue({ note: 'Hi, man!' });
          return;
        case 'female':
          form.setFieldsValue({ note: 'Hi, lady!' });
          return;
        case 'other':
          form.setFieldsValue({ note: 'Hi there!' });
      }

  };
  

  return (
    <Form {... Layout} form= {form} name = "control-hooks" onFinish={finish}>
        <Form.Item
            name={['name']}
            label= "Nome completo"
            rules={[{required: true}]}
        >
            <Input placeholder='Nome completo'></Input>
        </Form.Item>

        <Form.Item name="gender" label="Genêro" rules={[{required: true}]}>
            <Select
                placeholder='Selecione seu sexo'   
                onChange={onGenderChange}       
            >                
                <Option value="male">male</Option>
                <Option value="female">male</Option>
                <Option value="other">Outro</Option>
            </Select>
        </Form.Item>

        <Form.Item
            name={['birth']} 
            label="Data de nascimento"  
            rules={[{required: true}]}   
               
        >
            <DatePicker picker="date" placeholder='Data de nascimento' format={dateFormat}></DatePicker>

        </Form.Item>

        <Form.Item
            name={['email']}
            label="email"
            rules={[
                {required: true},
                {type:'email',
                message:"Este email não é valido"}
            
            ]}
        >   
            <Input></Input>

        </Form.Item>

        <Form.Item
            name={['phone']}
            label="Telefone"
            rules={[{required: true}]}
        >
            <Input type='phone'  
            ></Input>
        </Form.Item>
        <Button type="primary" htmlType="submit">Salvar</Button>

        


    </Form>
  )

}
export default App;
